import tkinter as tk
from tkinter import *
import ttkbootstrap as ttk
from ttkbootstrap.constants import *
from modules.config import config
from time import sleep

class UI:
    def __init__(self, conf:config) -> None:
        self.conf=conf
        self.appTitle = "BTChat"
        self.height = 600
        self.width = 400
        self.cn = None
        self.active=False
        
        self.cLc = 0
        self.label_list = []
        self.last_place = 400

        self.window = tk.Tk()
        self.window.title(self.appTitle)

        self.Tchaticon = PhotoImage(data=bytes.fromhex(''))
        self.me_icon = PhotoImage(data=bytes.fromhex(''))
        self.next_icon = PhotoImage(data=bytes.fromhex(''))
        self.loginiconpic=PhotoImage(data=bytes.fromhex(''))
        self.send_img=PhotoImage(data=bytes.fromhex(''))
        self.blank_img=PhotoImage(data=bytes.fromhex(''))
        self.login_frame=Frame(
            self.window,
            background="#D9D9D9"
        )

        self.profile_label=Label(
            self.login_frame,
            image=self.loginiconpic,
            height=200,
            anchor=CENTER,
            background="#D9D9D9"
        )

        self.login_entry=Entry(
            self.login_frame,
            font=("arial",20),
            justify="center",
            highlightthickness=0
        )#collect the login id from this entry box

        self.login_Button=Button(
            self.login_frame,
            image=self.next_icon,
            relief="flat",
            border=0,
            command=lambda x=self:self.login(x),
            activebackground="#D9D9D9"
        )
        
        self.chat_frame=Frame(
            self.window,
            bg="#EEEEEE"
        )

        self.top_box=Frame(
            self.chat_frame,
            bg="#DDDDDD"
        )

        self.msg_canv=Canvas(
            self.top_box,
            height=self.return_percentage(root=self.chat_frame,percentage=0.9),
            bg="red"
        )

        self.bottom_box=Frame(
            self.chat_frame,
            bg="#EEEEEE"
        )

        self.msg_enter=Entry(
            self.bottom_box,
            font=("arial",12),
            relief="flat",
            borderwidth=0,
            highlightthickness=0
        )

        self.msg_send_button=Button(
            self.bottom_box,
            image=self.send_img,
            bg="#EEEEEE",
            relief="flat",
            borderwidth=0,
            highlightthickness=0,
            highlightbackground="#EEEEEE"
        )

        self.msg_send_button.config(command=lambda x=self:self.send_msg(x))
        self.msg_enter.bind("<Return>",self.send_msg)
        self.show_login_page()

    def button_flick(self):
        self.msg_send_button.config(
            image=self.blank_img
        )
        self.window.update()
        sleep(0.005)

        self.msg_send_button.config(
            image=self.send_img 
        )
    
    def if_msg_added(self,x:bool):
        if x== True:
            for i in self.label_list:
                y_ax=i.winfo_y()
                i.place(x=0,y=y_ax)
                print(y_ax)

    def return_percentage(self,root:Frame,percentage:float):
        return int((root.winfo_reqheight() *600) * percentage)

    def create_msg_dilogBox(self, profile_pic:PhotoImage, user:str, msg:str):
        if user == self.cn.id:
            self.if_msg_added(True)
            frame_for_msg=Canvas(self.msg_canv,height=50,width=390)
            frame_for_msg.create_image(360,25,image=profile_pic,anchor=CENTER)
            # frame_for_msg.create_text()
            frame_for_msg.place(x=0,y=540,anchor="sw")
            return frame_for_msg
        else:
            msg_label=Label(self.msg_frame,text=msg+"-:you",image=profile_pic,compound="right")
            msg_label.pack(fill="x",side="bottom",expand=True,anchor=N)
            return msg_label
        
    def center_horizontal(self, root, chield, x:float=0.5, y:float=0.5):
        chield.place(in_=root, relx=y, rely=x, anchor='center', height=40)
    
    def set(self, contriler): # It set Controler for calling function
        self.cn = contriler

    def go_up(self, event): # scroll up
        print("go down")
    


    def go_down(self, event): # scroll down
        print("go down")
       
    def add_msg(self, data:dict, append:bool=True, pos=0):
        current_msg = str(data["data"])
        sender_id = data["id"]
        lebel = self.create_msg_dilogBox(profile_pic=self.me_icon, user=sender_id, msg=current_msg)
        self.label_list.append(lebel)
        

    def send_msg(self, event):
        current_msg = self.msg_enter.get()
        self.button_flick()
        if current_msg.isspace() == False and len(current_msg) > 0:
            # self.add_msg(data={"data":current_msg,"id":self.cn.id})# i changed this part 
            if not self.cn == None:
                self.cn.send(current_msg)

    def login(self,event):
        id = self.login_entry.get()
        if id.isalpha():
            self.cn.id = id # i changed this part 
            self.cn.start_lisiner()
            self.login_frame.destroy()# destroy login page
            self.show_chat_frame()


    def create_window(self):
        self.window.minsize(self.width, self.height)
        self.window.maxsize(self.width, self.height)
        self.window.iconphoto(True, self.Tchaticon)

    def show_login_page(self):#here is the login page

        self.login_frame.pack(side="top",fill="both",expand=True,anchor=NW,)
        self.profile_label.pack(side="top",fill="both",expand=True,anchor=CENTER)
        self.login_entry.pack(anchor=CENTER,side="top",fill="x",expand=True,padx=10)
        self.login_Button.pack(anchor=CENTER,side="top",fill="none",expand=True)
        self.login_entry.focus()
        self.login_entry.bind("<Return>",self.login)

    def show_chat_frame(self):

        self.chat_frame.pack(side="top",anchor=N,fill="both",expand=True)
        self.top_box.config(height=self.return_percentage(root=self.chat_frame,percentage=0.9))
        self.top_box.pack(side="top",anchor=N,expand=True,fill="x",padx=5)
        
        self.msg_canv.pack(side="top",fill="both",anchor=N,expand=True)
        # self.msg_canv.create_rectangle(0,0,390,540,fill="black")


        self.bottom_box.config(height=self.return_percentage(root=self.chat_frame,percentage=0.1))
        self.bottom_box.pack(side="bottom",anchor="s",fill="x",expand=True,padx=5)
        
        self.msg_enter.pack(anchor=CENTER, side="left", fill="both", expand=True, pady=5)      
        self.msg_send_button.pack(anchor=E, side="right", fill="both", expand=True, pady=5)   
        self.msg_enter.focus()
 
    def run(self):
        self.active=True
        self.window.mainloop()